import { 
    Flex, 
    Divider,
    Link as ChakraLink
} from "@chakra-ui/react";
import { Link } from "react-router-dom";

const FooterLinks = () => {
  return (
    <Flex flexDir="row" align="center" fontSize={24} gap={3} h={5} mt={1}>
      <ChakraLink to="/">Home</ChakraLink>
      <Divider orientation="vertical" borderColor="#000000"/>
      <ChakraLink to="/about">About</ChakraLink>
      <Divider orientation="vertical" borderColor="#000000"/>
      <ChakraLink to="rate">Rate My Resume</ChakraLink>
    </Flex>
  );
};

export default FooterLinks;
